import React, { Component, useContext } from "react";
import axios from "axios";
import { observer } from "mobx-react-lite";
import { birthContext } from "../context/birth";
import Link from "next/link";
const linkStyle = {
  marginRight: "1rem",
};
const topnavbar = observer(({ req }) => {
  const birthInfo = useContext(birthContext);
  return (
    <div>
      <Link href="/6rKA7IKs7ZWc7IKs656M">
        <a style={linkStyle}>검사한사람</a>
      </Link>
      <Link href="/a2FrYW90YWxr7Jy866Gc6rCA7J6F7ZWc7IKs656M">
        <a style={linkStyle}>카카오톡으로 회원가입한사람</a>
      </Link>
    </div>
  );
});

/*topnavbar.getInitialProps = async ({ req }) => {
  return req
    ? { from: "server" } // 서버에서 실행 할 시
    : { from: "client " }; // 클라이언트에서 실행 할 시
};*/

export default topnavbar;
